function getLinks(data){
	console.group("getLinks()");
	// console.table(data);
	// console.table(allPortals)
	for(const link of data){
		let newLink = new Link();
		let fromPortal = $.grep(allPortals, function(e){
			// console.log(`(${e.name} == ${link.originName}) = ${e.name == link.originName}`);
			return e.name == link.originName;
		})[0]

		let toPortal = $.grep(allPortals, function(e){
			return e.name == link.destinationName;
		})[0]

		if(!firstOutgoing.includes(fromPortal) && !firstIncoming.includes(fromPortal)){
			firstOutgoing.push(fromPortal);
		}
		if(!firstOutgoing.includes(toPortal) && !firstIncoming.includes(toPortal)){
			firstIncoming.push(toPortal);
		}

		toPortal.keysNeed++;

		newLink.index = link.linkNum;
		newLink.fromPortal = fromPortal;
		newLink.toPortal = toPortal;


		allLinks.push(newLink);
		// console.log(`'${fromPortal.name}', ;'${toPortal.name}'`);
	}
	console.groupEnd("getLinks()");
}

function FarmKeys(fromPortal, toPortal){
	this.fromPortal = fromPortal;
	this.toPortal = toPortal;
}


function Step(type, index, action, keysNeeded){
	this.type = type;
	this.index = index;
	this.action = action || undefined;
	this.keysNeeded = keysNeeded || 0;
}

function Link(index, fromPortal, toPortal){
	this.index = index;
	this.fromPortal = fromPortal;
	this.toPortal = toPortal;
}

function cleanData(data){
	console.groupCollapsed("cleanData()");
	let lines = $.csv.parsers.splitLines(data);
	let output = [];
	let newHeader = [];

	for(const str of lines[0].replaceAll(", ", ",").split(',')){
		newHeader.push(camelize(str));
	}
	lines[0] = newHeader.join();

	for(let i = 0; i < lines.length; i++) {
		
		
		if(lines[i] === '') continue;
		lines[i] = lines[i].replaceAll(", ", ",");
		output.push(lines[i]);
	}
	console.groupEnd("cleanData()");
	return output.join('\n');
}

function camelize(str){
	return str.replace(/(?:^\w|[A-Z]|\b\w|\s+)/g, function(match, index) {
		if(+match === 0) return ""; // or if (/\s+/.test(match)) for white spaces
		return index === 0 ? match.toLowerCase() : match.toUpperCase();
	});
}

