function addStepRow(step){
	// console.log(step)
	const row = $('<div/>')
		.addClass('table-row')
		.html(stepRowTemplate.html())
		.appendTo(stepsTable)
		.attr('index', stepsTable.children().length)
	
	const rowContent = row.find('.table-row--content');
	
	
	const contentCollappsedHeader = rowContent.find('.cell--collapsed-header');
	const stepCell = rowContent.find('.step-cell .cell--content');
	const actionCell = rowContent.find('.action-cell .cell--content');
	const keyFarmCell = rowContent.find('.key-farm-cell .cell--content');
	const fromPortCell = rowContent.find('.from-portal-cell .cell--content');
	const toPortCell = rowContent.find('.to-portal-cell .cell--content');


	// if(fromPort == toPort) toPort = tempPortalList[randomNum(0, tempPortalList.length-1)];

	stepCell.text(`Step #${('0'.repeat(allSteps.length.toString().length-1) + step.index).slice(-allSteps.length.toString().length)}`)
	actionCell.text(step.type);
	keyFarmCell.text(step.keysNeeded);
	fromPortCell.text(step.action.fromPortal.name);
	toPortCell.text(step.action.toPortal.name);

	const rowDone = row.find('.table-row--done')
			.html(rowContent.html())
			.hide()
			

	rowDone.find('.key-farm-cell .cell--content').text("DONE :)")
	rowDone.find('.from-portal-cell .cell--content').css('opacity', '0')
	rowDone.find('.to-portal-cell .cell--content').css('opacity', '0')

	row.dblclick(function(){
		doneAction = rowDone.toggle('blind', {direction: 'left'})
		if(win.width() < breakpoint){
			
			if(!row.hasClass('row-is-done')){
				// rowDone.toggle('blind', {direction: 'left', duration: 500});
			
				let tempWrapper = contentCollappsedHeader.siblings()
					.wrapAll('<div/>').parent()
					.addClass('table-row')
				
				wrapAction = tempWrapper.delay(100).slideUp(500);
				
				$.when(wrapAction).done(function(){
					row.addClass('row-is-done');
					tempWrapper.children().unwrap();
				})
			}

			if(row.hasClass('row-is-done')){
				// rowDone.toggle('blind', {direction: 'left'});
				let tempWrapper = contentCollappsedHeader.siblings()
					.wrapAll('<div/>').parent()
					.addClass('table-row')
					.css('display', 'none')

					row.removeClass('row-is-done');

				wrapAction = tempWrapper.delay(100).slideDown(500);

				$.when(wrapAction).done(function(){
					tempWrapper.children().unwrap();
				})
			}
			return;
		}
		
		if(win.width() > breakpoint){
			$.when(doneAction).done(function(){
				row.toggleClass('row-is-done');
			})
		}
		
		
		
	
	})
	
	
}

